# This macro prints a 1-walled, vase mode heat tower/cube with 8 segments, each 5mm tall.
# In case of replacing the G-code: change your START_PRINT to START_TUNING_PRINT and your END_PRINT to END_TUNING_PRINT
# Also, change the first 'M106' to 'M106 S{printer["gcode_macro Calibration_Tool"].fan}', there should'nt ne any other M106 after this.n}
# Make sure to delete any M104 command, exept the last one 'M104 S0'
# Direct Copy/Paste the G-code doesn't work because of missing indentation. 
  # I use Notepad++ to select all G-code and indent them at once with Caps Lock + Tab. After that, copy and paste the G-code and make the changes mentioned before.
# For Slicing the heat_tower.stl, use the following (CURA) settings:
  # extruder temperature: doesn't matter because macro overwrites it anyway
  # bed temperature: doesn't matter because macro overwrites it anyway
  # cooling fan: doesn't matter because macro overwrites it anyway
  # layer height: 0.2
  # line width: 0.4 
  # flow: 100 %
  # bottom layers: 0
  # top layers: 0
  # infill: 0%
  # use brim
  # spiralize / vase mode
  # print speed: use your usual printer speed
  # Activate firmware retract in your slicer and add it to your printer.cfg # https://www.klipper3d.org/G-Codes.html?h=firmwa#firmware_retraction
    # For Cura (which does not support it natively), install the "Printer Settings" plugin and activate it there.
    
[gcode_macro HEAT_TEST]
description: Print to determine and the optimal Printtemperature @ 100mm/s
